#include <iostream>
#include <string>
using namespace std;

int main()
{
    string str1= " ", str2= " ";
    char diff= ' ';
    cout<<"Enter String 1\t";   cin>>str1;  str1= str1+ ' ';
    cout<<"Enter String 2\t";   cin>>str2;
    int i= 0, j= 0, len= str2.size();
    for( ; i< len; i++)
    {
        for( ; j< len; j++)
        {
            if(str1[i]==str2[j])
            {
                str2[j]= ' ';
                break;
            }
        }
    }
    for(i= 0; i< len; i++)
    {
        if(str2[i]!=' ')
            diff= str2[i];
    }
    cout<<"The Difference is "<<diff;
}
